import React,{Component} from 'react';
import {Link} from 'react-router-dom';

class Header extends Component{
    render(){
        return(
            <>
                <span>만다라트</span>
                <ul>
                    <li><Link to="/login">로그인</Link></li>
                    <li><Link to="list"></Link></li>
                </ul>
            </>
        )
    }
}

export default Header;
